import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Homepage from './Homepage';
import Login from './Login'; // Eğer Login bileşenini ayrı bir dosyada oluşturduysanız
import SignUp from './SignUp';
import Product from './Product'; // Eğer ürün sayfanız varsa
import Cart from './Cart'; // Eğer sepet sayfanız varsa
import AboutUs from './AboutUs'; // Eğer hakkımızda sayfanız varsa

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Homepage />} />
                <Route path="/login" element={<Login />} />
                <Route path="/signup" element={<SignUp />} />
                <Route path="/product" element={<Product />} />
                <Route path="/cart" element={<Cart />} />
                <Route path="/about" element={<AboutUs />} />
            </Routes>
        </Router>
    );
};

export default App;
